import React from 'react'
import Data from './Data'

class MaineContent extends React.Component {
    constructor(){
        super()
        this.state={
            data: Data.map(items =>
                <div className="product col-sm-6 col-md-4 col-lg-3" key={items.id}>
                    <div className="images_plate_holder"><img className="height-200" src={items.linkImage}  alt=""/></div>
                    <div className="well">product</div>
                </div> )
        }
    }
    render() {
     return(
         <div className="row">
             {this.state.data}
         </div>
        )
    }

}

export default MaineContent
